import axios from '../api/axios';

export const getDonors = () => {
  return axios.get('donor/donordoctor');
};

export const getDonorById = (id) => {
  return axios.get(`donor/donordoctor/${id}`);
};

export const createDonor = (donor) => {
  return axios.post('donor/donordoctor', donor);
};

export const updateDonor = (id, donor) => {
  return axios.put(`donor/donordoctor/${id}`, donor);
};

export const deleteDonor = (id) => {
  return axios.delete(`donor/donordoctor/${id}`);
};
